import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonCheckbox, IonList,
  IonItem, IonLabel, IonCard, IonCardContent, IonCardSubtitle, IonCardHeader, IonCardTitle, IonButtons }
  from '@ionic/react';
import React from 'react';
import { RouteComponentProps } from 'react-router';

const SetProfile: React.FC<RouteComponentProps> = ({history}) => {
  return(
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Demographic Questions</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonCard>
        <IonCardContent>
            Keep close to Nature's heart... and break clear away, once in awhile,
            and climb a mountain or spend a week in the woods. Wash your spirit clean.
        </IonCardContent>
      </IonCard>
    </IonPage>
  );
};

export default SetProfile;
